using System;
using System.Linq;
using System.Reflection;

namespace CustomSoundSystem.RunTime
{
    public static class SoundSystemReferences
    {
        private static readonly string defaultInternalFolderPath = "Assets/_Scripts/Systems/SoundSystem/";
        private static string customInternalFolderPath = "";

        public static string InternalFolderPath
        {
            get
            {
                if (string.Equals(customInternalFolderPath, "")) return defaultInternalFolderPath;
                return customInternalFolderPath;
            }
            set => customInternalFolderPath = value;
        }

         public static Assembly assembly=AppDomain.CurrentDomain.GetAssemblies()
             .FirstOrDefault(a => a.GetName().Name == "Assembly-CSharp");

        //public static Assembly assembly = Assembly.GetExecutingAssembly();
        
        public static Type SoundSourceKeysType=assembly.GetTypes()
            .FirstOrDefault(type => type.IsEnum && type.Namespace == "CustomSoundSystem" && type.Name == "SoundSourceKeys");    
        public static Type SoundTypeKeysType=assembly.GetTypes()
            .FirstOrDefault(type => type.IsEnum && type.Namespace == "CustomSoundSystem" && type.Name == "SoundTypeKeys"); 

        //Buttons Texture Data
        public static readonly string[] textureData =
        {
            "",
            "",
            "",
            ""
        };
        

    }

}
